import { useState } from 'react'
function App() {
  const [count, setCount] = useState[1] //Here count is variable and setCont is function.
  const addCount = () => {
    setCount(count + 1) //Passing argument as count+1. It will lead to change value of count
  }

  return (
    <div>
      <button onClick={addCount} >Add Count</button>
      <h1>Count down:  {count} </h1>
      <br />
    </div>
  );
}

export default App;
